import React from "react";

const Panel = ({ makaka = {}, classes = [], children }) => {
  return (
    <div className={`pnl-ctn`} style={makaka.container}>
      <div
        className={classes.reduce(
          (x, next) => x.toString() + " " + next.toString(),
          "pnl"
        )}
      >
        {children}
      </div>
    </div>
  );
};

export default Panel;
